import React from 'react';
import { 
  styled,
  Box,
} from "@mui/material";


const Foo = styled(Box)(() => ({
  position: 'absolute',
  bottom: '0px',
  left: '0px',
}));
const FooWrap = styled(Box)(() => ({
  textAlign: 'center',
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
}));

export default function Footer() {
  return (
    <Foo>
      <FooWrap>
        <p>&copy; Quiz App 2023</p>
      </FooWrap>
    </Foo>
  );
}
